primary_outcome.description:
The occurrence of any of the following toxicities during Cycle 1 (Days 1-21), if assessed by the Investigator to be possibly, probably or definitely related to MK-1966 or SD-101, was considered a DLT:
Grade (Gr) 4 non-hematologic toxicity;
Gr 4 hematologic toxicity lasting >7 days, except thrombocytopenia: *Gr 4 thrombocytopenia of any duration; *Gr 3 thrombocytopenia if associated with bleeding;
Gr 3 non-hematologic toxicity lasting >3 days despite optimal supportive care;
Any Gr 3 or Gr 4 non-hematologic laboratory abnormality, if: medical intervention is required OR abnormality leads to hospitalization OR abnormality persists for >1 week;
Febrile neutropenia Gr 3 or Gr 4;
Any drug-related AE which caused participant to discontinue study drug during Cycle 1
Gr 5 toxicity; or
Delay in initiation of Cycle 2 for >2 weeks due to study drug-related toxicity. The percentage of participants who experienced a DLT during Cycle 1 is presented.

